<?php
namespace tomk79\renconBuilder;

class framework_files {
   public function get( $className ) {
       $files = array(
           "rencon" => '',
           "conf" => '',
           "dataDotPhp" => '',
           "filesystem" => '',
           "request" => '',
           "auth" => '',
           "user" => '',
           "initializer" => '',
           "resources" => '',
           "theme" => '',
       );
       return base64_decode($files[$className]);
   }
}
